static void **traceGL_NativeArray = (void **) &traceGL_Native;

static void *traceGL_lazyGetProcAddress(const char *name);

/* Lookup native proc address for API function and update traceGL_NativeArray. */

void
traceGL_lookupNativeAddress(const char *name, void **procPtr)
{
  void *proc = NULL;
  size_t index = procPtr - traceGL_NativeArray;

  assert(name);
  assert(index < 2266);
  assert(!strcmp(name, traceGL_apiFuncNames[index]));

  /* Check if API function address already loaded. */

  if (traceGL_NativeArray[index])
    return;

  /* Obtain proc address using GL GetProcAddress API function. */

  proc = traceGL_lazyGetProcAddress(name);

  /* Check if API function address loaded from traceGL. */

  if (proc == traceGL_WrapperArray[index])
  {
    traceWarning("Ignoring %s loaded from traceGL library.", name);
    proc = NULL;
  }

  traceGL_NativeArray[index] = proc;
}

/* Binary search function for proc address lookup. */

static int CompareStrcmp(const void *a, const void *b)
{
  return strcmp(*(const char **) a, *(const char **) b);
}

/* Lookup wrapper proc address for the GL API function. */

void *
traceGL_lookupWrapperAddress(const char *name, void *proc)
{
  const char **res = NULL;

  if (!name)
  {
    traceWarning("Cannot load function without name.");
    return NULL;
  }

  res = (const char **) bsearch(&name, traceGL_apiFuncNames, 2265, sizeof(const char *), CompareStrcmp);
  if (res)
    return traceGL_WrapperArray[(size_t) (res - traceGL_apiFuncNames)];

  traceWarning("Trace does not support %s.", name);
  return proc;
}

/* TraceGL wrapper for GetProcAddress. */

static void *
traceGL_lazyGetProcAddress(const char *name)
{
#if defined(_WIN32)
  return traceGL_wglGetProcAddress ? traceGL_wglGetProcAddress(name) : NULL;
#elif !defined(__APPLE__)
  return traceGL_glXGetProcAddress ? traceGL_glXGetProcAddress(name) : NULL;
#else
  return NULL;
#endif
}
